INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("カリン", "2030/01/01 14:59:59", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 1, -416.5, 1000001, 2, 1, 190801, 1, 62, "2025/01/31 12:00:00", 3.414, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("カリン", "2030/01/01 14:59:59", "ミッションをクリアして、\n報酬をゲットしましょう！", 2, -416.5, 1000002, 2, 1, 190801, 1, 62, "2025/01/31 12:00:00", 3.099, 0.0);
