INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("カリン", "2030/01/01 14:59:59", "報酬がもらえますよ！\nチェックしてみてください", 4, -416.5, 1000004, 2, 1, 190801, 2, 63, "2025/01/31 12:00:00", 0.0, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("カリン", "2030/01/01 14:59:59", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 5, -363.0, 1000005, 1, 1, 190801, 2, 64, "2025/01/31 12:00:00", 2.12, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("カリン", "2030/01/01 14:59:59", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 6, -363.0, 1000006, 2, 1, 190801, 1, 64, "2025/01/31 12:00:00", 1.68, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("カリン", "2030/01/01 14:59:59", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 7, -363.0, 1000007, 1, 1, 190801, 2, 64, "2025/01/31 12:00:00", 2.33, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("ラビリスタ", "2030/01/01 14:59:59", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 101, -285.0, 1020101, 7, 10201, 133701, 3, 61, "2025/01/31 12:00:00", 5.18, -6.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("クリスティーナ", "2030/01/01 14:59:59", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 201, -285.0, 1020102, 2, 10201, 133901, 1, 61, "2025/01/31 12:00:00", 8.77, -2.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("ネネカ", "2030/01/01 14:59:59", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 301, -285.0, 1020103, 1, 10201, 133801, 6, 61, "2025/01/31 12:00:00", 15.5, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("ランファ", "2030/01/01 14:59:59", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 101, -285.0, 1020201, 5, 10202, 134301, 2, 61, "2025/02/28 12:00:00", 9.061, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("チカ", "2030/01/01 14:59:59", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 201, -285.0, 1020202, 2, 10202, 134401, 1, 61, "2025/02/28 12:00:00", 7.699, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("アオイ", "2030/01/01 14:59:59", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 101, -285.0, 1020301, 2, 10203, 134601, 1, 61, "2025/03/31 12:00:00", 8.595, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("クローチェ", "2030/01/01 14:59:59", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 201, -285.0, 1020302, 2, 10203, 134501, 1, 61, "2025/03/31 12:00:00", 7.758, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("ルイズマリー", "2030/01/01 14:59:59", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 101, -285.0, 1020401, 6, 10204, 132302, 2, 61, "2025/04/30 12:00:00", 7.0, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("イロハ", "2030/01/01 14:59:59", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 201, -285.0, 1020402, 2, 10204, 132402, 1, 61, "2025/04/30 12:00:00", 7.904, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("ソノ", "2030/01/01 14:59:59", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 301, -285.0, 1020403, 2, 10204, 132502, 4, 61, "2025/04/30 12:00:00", 8.487, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("カノン", "2030/01/01 14:59:59", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 101, -285.0, 1020502, 2, 10205, 134901, 1, 61, "2025/05/31 12:00:00", 8.763, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("ツムギ", "2030/01/01 14:59:59", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 201, -285.0, 1020503, 3, 10205, 134801, 1, 61, "2025/05/31 12:00:00", 6.417, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("エリス", "2030/01/01 14:59:59", "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 101, -285.0, 1020601, 7, 10206, 135001, 3, 61, "2025/06/30 12:00:00", 10.335, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("シェフィ", "2030/01/01 14:59:59", "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 201, -285.0, 1020602, 4, 10206, 135101, 2, 61, "2025/06/30 12:00:00", 6.281, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("プレシア", "2030/01/01 14:59:59", "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 301, -285.0, 1020603, 2, 10206, 135201, 1, 61, "2025/06/30 12:00:00", 12.244, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("クリア", "2030/01/01 14:59:59", "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 101, -285.0, 1020701, 8, 10207, 135301, 2, 61, "2025/07/31 12:00:00", 6.339, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("アネモネ", "2030/01/01 14:59:59", "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 201, -285.0, 1020702, 9, 10207, 135401, 7, 61, "2025/07/31 12:00:00", 8.184, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("アイラ", "2030/01/01 14:59:59", "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 101, -285.0, 1020801, 2, 10208, 129101, 9, 61, "2025/08/31 12:00:00", 3.906, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("シナツ", "2030/01/01 14:59:59", "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 201, -285.0, 1020802, 2, 10208, 129201, 1, 61, "2025/08/31 12:00:00", 14.465, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("ヒヨリ", "2030/01/01 14:59:59", "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 301, -285.0, 1020803, 3, 10208, 100101, 4, 61, "2025/08/31 12:00:00", 8.662, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("レイ", "2030/01/01 14:59:59", "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 401, -285.0, 1020804, 3, 10208, 100301, 1, 61, "2025/08/31 12:00:00", 10.915, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("ユキノ", "2030/01/01 14:59:59", "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 101, -285.0, 1020901, 7, 10209, 135802, 1, 61, "2025/09/30 12:00:00", 6.042, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("サツキ", "2030/01/01 14:59:59", "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 201, -285.0, 1020902, 1, 10209, 135903, 4, 61, "2025/09/30 12:00:00", 9.402, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("ルルィ", "2030/01/01 14:59:59", "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 301, -285.0, 1020903, 1, 10209, 136902, 8, 61, "2025/09/30 12:00:00", 8.16, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("カスミ", "2030/01/01 14:59:59", "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 101, -285.0, 1021001, 2, 10210, 137402, 3, 61, "2025/10/31 12:00:00", 5.0, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("アラクネ", "2030/01/01 14:59:59", "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 201, -285.0, 1021002, 1, 10210, 136001, 4, 61, "2025/10/31 12:00:00", 8.12, 0.0);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("ナーナ", "2030/01/01 14:59:59", "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 301, -285.0, 1021003, 2, 10210, 136202, 4, 61, "2025/10/31 12:00:00", 6.386, 0.0);
